import React from "react";
import "./style.css";
import Card from "../Card";
import { Col, Row, Container } from "../Grid";


function directory(props){

    var employeeList = [
        {
            name: "Danny Talmont",
            title: "Intern",
            phone: "555-555-5555",
            email: "dantalmont@gmail.com",
            duration: "1 year"
        },
        {
            name: "Mike Talmont",
            title: "Intern",
            phone: "555-555-5555",
            email: "dantalmont@gmail.com",
            duration: "1 year"
        },
        {
            name: "Joe Talmont",
            title: "Intern",
            phone: "555-555-5555",
            email: "dantalmont@gmail.com",
            duration: "1 year"
        },
        {
            name: "Miles Talmont",
            title: "Intern",
            phone: "555-555-5555",
            email: "dantalmont@gmail.com",
            duration: "1 year"
        },
        {
            name: "Yue Talmont",
            title: "Intern",
            phone: "555-555-5555",
            email: "dantalmont@gmail.com",
            duration: "1 year"
        },
        {
            name: "Rose Talmont",
            title: "Intern",
            phone: "555-555-5555",
            email: "dantalmont@gmail.com",
            duration: "1 year"

        },
    ];

    return (
        <Row>
            {
                employeeList.map(employee => (

                    <Card 
                    name = {employee.name}
                    title = {employee.title}
                    phone = {employee.phone}
                    email = {employee.email}
                    duration = {employee.duration}

                    ></Card>
                ))
            }
        </Row>
    );
}

export default directory;
